    <body>
     <header>
        <span class="01">메인으로</span>
        <div class="Line-2"></div>
        <span class="02"><a href="">정책 페이지</a></span>
     </header>

    <section>
    <Main/>
    </section>
    </body>
  );
}

export default App;
